class Edit extends React.Component {
  render() {
    const link = "/recipes/"+this.props.id+"?_method=put";
    return (
      <html>
        <body>
          <div>
          <h1>Edit Page</h1>
          <form method="POST" action={link}>
          <p>Recipe Name</p>
            <input name="recipe name" value={this.props.name}/>
            <p>Ingredients</p>
            <input name="author" value={this.props.ingredients}/>
            <p>Instructions</p>
            <input name="author" value={this.props.instructions}/>
            <input type="submit" value="submit"/>
            </form>
          </div>
        </body>
      </html>
    );
  }
}

module.exports = Edit;

